// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from React Router
import './Navbar.css'; // Import Navbar styles

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-links">
        <li>
          <Link to="/">Bio</Link> {/* Link to the Bio (Home) page */}
        </li>
        <li>
          <Link to="/experience">Experience</Link> {/* Link to the Experience page */}
        </li>
        <li>
          <Link to="/projects">Projects</Link> {/* Link to the Projects page */}
        </li>
        <li>
          <Link to="/contact">Contact</Link> {/* Link to the Contact page */}
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
